(1, 'Jigar', 'Thakkar', 'admin', 'Caselaw', 'I am an NRI. I have non-resident (ordinary) or NRO and non-resident (external) or NRE accounts in India. I need to transfer my savings from salary (all taxes paid) to Australia. Am I required to produ', '<p><strong></strong>Under the exchange control law, remittances outside India from NRE account is generally allowed. However, remittance outside India up to $1 million per financial year is allowed out of balances held in <a data-saferedirecturl="https://www.google.com/url?q=https://www.livemint.com/Money/whXx91dz6w7ogTBXkcMDvK/NRI-taxation-Global-income-is-taxed-in-India-for-tax-reside.html&source=gmail&ust=1564239768801000&usg=AFQjCNFFRdyqHvMNlpT5OljbpL7ckb65RA" href="https://www.livemint.com/Money/whXx91dz6w7ogTBXkcMDvK/NRI-taxation-Global-income-is-taxed-in-India-for-tax-reside.html" rel="noreferrer" target="_blank">NRO account</a> on submission of documentary evidence and certificate from a chartered accountant in the prescribed format. Remittance exceeding $1 million will require special permission from the Reserve Bank of India (RBI).Under the income-tax law, the remitter is required to furnish prescribed information electronically in Form 15CA (self-declaration) based on a certificate obtained from a chartered accountant in Form 15CB, wherever applicable, on any payments made to an NRI.However, no information is required to be furnished for the following payments which are not chargeable to income tax under the income tax law:(a) Payments made by an individual which does not require prior approval from RBI; or (b) Payments given in the specified list&mdash;linked to RBI codes.One of the payments mentioned in the specified list is &ldquo;S1301 - Remittance by non-residents towards family maintenance and savings&quot;. Assuming that you intend to transfer your savings for maintenance of family, there is no requirement to furnish Form 15CA/Form 15CB in terms of exemption granted under Rule 37BB(3)(ii) of Income Tax Rules 1962.However, in practice, some banks may insist for Form 15CA/Form 15CB and/or additional documents to substantiate that India income tax has been paid for the funds being remitted.&nbsp;</p><p data-f-id="pbf" style="text-align: center; font-size: 14px; margin-top: 30px; opacity: 0.65; font-family: sans-serif;">Powered by <a href="https://www.froala.com/wysiwyg-editor?pb=1" title="Froala Editor">Froala Editor</a></p>', , 'Fri, 26th Jul 2019', '2019-07-26 15:39:52');
