(2, 'Jigar', 'Thakkar', 'admin', 'Rule', 'Basic Understanding ', '<p>There are certain compliances to make payments outside India, one of such compliance is submission of Form 15CA and 15CB.&nbsp;<strong>Rule 37BB&nbsp;</strong>defines the manner to furnish information in form 15CB and making declaration in form 15CA . &nbsp;</p><p data-f-id="pbf" style="text-align: center; font-size: 14px; margin-top: 30px; opacity: 0.65; font-family: sans-serif;">Powered by <a href="https://www.froala.com/wysiwyg-editor?pb=1" title="Froala Editor">Froala Editor</a></p>', , 'Fri, 26th Jul 2019', '2019-07-26 16:59:12');

